B.O3=new A.a0("Research has shown that the rotation of the hips (especially a lack or difference side to side in internal rotation) is a large factor in the development of back pain. If an athlete has a significant deficit in internal rotation on one side of the body, the low back will sustain uneven forces as the body drops into the bottom position of a squat, clean or snatch.",null,null,null,null,null,null,null)
