B.O6=new A.a0("Think about the movements that trigger your pain and select the ones from the following list or add your own:",null,null,null,null,null,null,null)
B.O7=new A.a0("No pain in any position",null,null,null,null,null,null,null)
B.O8=new A.a0("Perform a deep bodyweight squat and hold the bottom position. Have a friend watch and observe what happens to your low back as you reach the deepest portion of the squat.",null,null,null,null,null,null,null)
B.O9=new A.a0("Treatment List",null,null,null,null,null,null,null)
B.Oa=new A.a0("Back Pain : Squat Assessment",null,null,null,null,null,null,null)
