B.f2=new A.a0("No",null,null,null,null,null,null,null)
B.Oc=new A.a0("If instead you had pain that presented when rounding your back or extending your back under compression we can assume your back injury is triggered by postures out of \u201cneutral.\u201d We can refer to these problems as a \u201cflexion intolerance\u201d if your pain was brought out when rounding your back during the screen or \u201cextension intolerance\u201d if it was with the overly arched back. If you have an extension intollerance we will dive more into this in the prone assesment.",null,null,null,null,null,null,null)
B.Od=new A.a0("Back Pain : Ankle Assessment",null,null,null,null,null,null,null)
B.f1=new A.r(!0,null,null,null,null,null,25,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.Oe=new A.a0("There's a reason for you back pain",null,B.f1,null,null,null,null,null)
B.wh=new A.a0("Home",null,null,null,null,null,null,null)
B.f3=new A.a0("Yes",null,null,null,null,null,null,null)
B.Of=new A.a0("If you found pain presented when sitting with good posture during this screen, we can conclude that your symptoms are due to compression. Even when lifting with good posture, the added compression at this time (that largely comes from muscle contraction) is too much for your back and you must stop lifting heavy for the time being if you want your back to heal.",null,null,null,null,null,null,null)
B.Og=new A.a0("Back Pain : Sitting Assessment",null,null,null,null,null,null,null)
B.Oh=new A.a0("Did you notice anything different? If your pain is reduced after lying on your stomach for a few minutes we can assume that your back pain is in part triggered when in a flexed or rounded spine posture because we are able to unload it and make it feel better when putting it in a slightly extended position during this test.",null,null,null,null,null,null,null)
B.Oi=new A.a0("Lifting leg hurts but bracing helps",null,null,null,null,null,null,null)
B.bk=new A.r(!0,null,null,null,null,null,16,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.wi=new A.a0("Start by standing in your normal posture as if you\u2019re waiting in line at a grocery store. Have a friend take a photo of you from the side, front and from the back. What do you notice about your standing posture? Are your shoulders rounded? Is your chin poking out in front of your body? Is your low back flat or does it have an excessive arch? Do you feel certain muscles of your back flexing or contracting hard?",null,B.bk,null,null,null,null,null)
B.Oj=new A.a0("If you had pain during this test due to either reason, try to correct your low back position by holding it in neutral by bracing your core and properly hinge from the hips. Don't let your low back arch or round as you go down and squeeze your glutes while driving your heels into the ground on the ascent. Does this result in a slight decrease in pain compared to the first time? If so, you need to learn how to properly hinge at the hips and limit excessive movement (either in flexion or extension) from your back!",null,B.bk,null,null,null,null,null)
B.Ol=new A.a0("The first step in screening your low back is to do an in depth self-analysis of what triggers your pain. We need to find out exactly what causes your pain. These are the activities, movements and postures you assume throughout your day that bring out your symptoms.",null,B.bk,null,null,null,null,null)
B.Om=new A.a0("Back Pain : Self Assessment",null,null,null,null,null,null,null)
B.On=new A.a0("Movement analysis",null,B.f1,null,null,null,null,null)
B.wj=new A.a0("After doing your self-assessment, did you find a common motion, posture or load that triggers your pain? Did you also notice any specific movements that you can do without pain? If you did, you should breathe a sigh of relief. You just took the first step in eliminating your pain by making a conscious connection and link to the cause of your pain.",null,B.bk,null,null,null,null,null)
B.Oo=new A.a0("The last screen called a heel drop test looks into how your body deals with a quick compressive load. Start by standing on one leg and with your abdominals completely relaxed, raise up on your toes and quickly drop down onto your heel. Do this twice, once with two legs and again with one leg. Did this jarring motion to your spine cause pain?",null,null,null,null,null,null,null)
B.Op=new A.a0("Did this movement produce pain? As you bridge on one leg, this pain is a response to the uneven forces that are being placed on your back. This is due to the inability of the glutes to kick on appropriately and contribute to hip extension, which means the erectors of your low back have to pull double time. When this happens a ton of force is placed on the spine, which leads to the pain you felt.",null,null,null,null,null,null,null)
B.Oq=new A.a0("Back Pain",null,null,null,null,null,null,null)
B.Or=new A.a0("The next test is designed to see how your body responds during the movement of hip extension (the same movement that occurs at your hip joint when you stand up from a squat, pull a barbell from the floor or propel your body forward during a sprint). For a back to remain healthy, you must have hips that have the ability to generate the appropriate amount of force and fire at the appropriate time. This screen looks into just that and assesses how the muscles that surround your hips (primarily your glute max) work with the low back.",null,null,null,null,null,null,null)
B.Os=new A.a0("However, if bracing your core and performing the drop test increased your symptoms, it is a clue that you may be dealing with a possible end plate fracture of your spine. The stiffening of your core added even more compression to the heel drop movement and drove your symptoms to occur. If this is you, eliminating barbell training is a must at this time in order to allow the healing process to occur.",null,null,null,null,null,null,null)
B.wk=new A.a0("What was the result of the test?",null,null,null,null,null,null,null)
B.Ot=new A.a0("While lying on your back with your knees bent, straighten one leg out and perform a single leg bridge. Hold your hips in the air for 10 seconds and feel for what muscles are working hard to keep you up and if this movement brings out any pain.",null,null,null,null,null,null,null)
B.Ou=new A.a0("Find a bed or a spot on the floor and lie flat on your stomach. If this starts to hurt, stand back up and move to the next assessment (you likely have an extension intolerance that makes lying flat on your stomach painful). If this position is pain free, remain lying on your stomach for a few minutes. After, stand back up without letting your spine round (push up from your hands).",null,null,null,null,null,null,null)
B.Ov=new A.a0("Page Not Found",null,B.l5,null,null,null,null,null)
B.Ow=new A.a0("Often those who have pain while sitting in the bottom position of a squat do so because they have a posterior pelvic tilt (butt wink) that created an excessive round in the low back.  During the descent of the squat the thigh bone (femur) rotates in the hip socket (called the acetabulum). As the depth of the squat increases, the femur can eventually come into contact with the front rim of the socket. The timing of this contact will depend on the size of the femur and the depth of the socket (something we can thank our parents for). Because the femur can no longer rotate at this point, the pelvis must reflexively rotate backwards in order to continue the descent of the squat which then brings the low back into a rounded position as well.",null,null,null,null,null,null,null)
B.Ox=new A.a0("Support him at https://www.patreon.com/SquatUniversity",null,null,null,null,null,null,null)
B.wm=new A.a0("Did one of these positions illicit pain?",null,null,B.dI,null,null,null,null)
B.Oy=new A.a0("To screen for hip internal rotation problems, start by lying on your back. Have a friend grab your leg, bend your knee and lift your thigh to a 60\xb0 angle from the bed or floor.",null,null,null,null,null,null,null)
B.Oz=new A.a0("In that same prone position (lying on your stomach), raise one leg at a time off the table (make sure to keep it completely straight). It doesn\u2019t need to move far but each of us should have around 10 degrees of hip extension. Assess both legs and compare how much movement occurs at each hip and whether or not any pain was produced in the low back.",null,null,null,null,null,null,null)
B.OA=new A.a0("All content is the intellectual property of Aaron Horschig",null,null,null,null,null,null,null)
B.OC=new A.a0("What muscles were working hard to keep your hips up? If it was anything other than your glutes (butt muscles) as the primary muscle group you have a coordination issue in how your body is producing hip extension. Research has shown that back pain can often inhibit the activation of your glutes (they basically become turned off and stop functioning correctly). This has been termed to by Dr. Stuart McGill as \u201cgluteal amnesia.\u201d",null,null,null,null,null,null,null)
B.OD=new A.a0("Were you able to rotate 45-degrees each way? (the pvc pipe aligned with the tape on the ground)",null,null,null,null,null,null,null)
B.OE=new A.a0("From this position we can rotate the lower leg away from the midline of the body to assess the amount of internal rotation you have. Perform the same movement on both legs. If you could move one leg a few inches away from the midline of the body more than the other, it means you have a significant difference in side-to-side internal rotation",null,null,null,null,null,null,null)
B.OG=new A.a0("Think about the movements that trigger your pain and select the ones from the following list:",null,null,null,null,null,null,null)
B.OH=new A.a0("Load Test",null,B.l4,null,null,null,null,null)
B.OL=new A.a0("If this was you, try to now perform a double leg bridge. Jam your heels into the ground and squeeze your butt muscles as you raise your hips from the ground. Make sure to keep your low back from over arching (don\u2019t raise your hips too high off the ground). Is the pain less than before? If the pain lessens, this demonstrates that your glutes are weak and need to strengthen. Strengthening the glutes to eventually be able to single leg bridge with proper glute activation will be an integral part of your rehab program.",null,null,null,null,null,null,null)
B.OK=new A.a0("Now, repeat this test with a small brace of your core. Did you notice anything different? If bracing your core eliminated your pain when performing the heel drop, you just uncovered a possible reason for why you have pain when performing movements like box jumps, catching a clean or snatch, or when running. Each of these movements loads the spine quickly and your body is not able to handle the load due to the inability to stabilize at the right time.",null,null,null,null,null,null,null)
B.OM=new A.a0("Tape an \u201cX\u201d on the ground with the edges forming 90-degree angles. Sit in the middle of the \u201cX\u201d so that the tape forms a \u201cV\u201d in front of you. With a PVC pipe across your chest, rotate as far as you can to the right and left side. Ideally you should be able to rotate your T-spine 45-degrees each way (this will align the PVC pipe with the tape on the ground).",null,null,null,null,null,null,null)
B.OO=new A.a0("Assessments",null,B.f1,null,null,null,null,null)
B.OR=new A.a0("Laying flat hurts",null,null,null,null,null,null,null)
B.OQ=new A.a0("Next, grab the stool with your hands and pull upwards to compress your spine. What did you feel? Did this action create pain in your back? Next, round your lower back and perform the same pulling motion. What happened this time? Did you have pain in your back now that it we added a bit of compression in the rounded position? Do the test one more time, but now with an overly arched back (spinal extension). Write down what you find.",null,null,null,null,null,null,null)
B.OT=new A.a0("If however, you still had pain even when bracing your core it means your body is very load intolerant. This means you need to eliminate any weight training and heavy lifting outside of the gym (moving furniture around the house, picking up multiple bags of groceries, etc.) for the time being to allow your back symptoms to calm down.",null,null,null,null,null,null,null)
B.OU=new A.a0("Back Pain : Prone Assessment",null,null,null,null,null,null,null)
B.OV=new A.a0("Is having butt wink automatically a sign of impending back pain? Not necessarily. However, if the motion happens to a great degree under load and/or occurs enough times during the squat, the potential to create a back injury greatly increases.",null,null,null,null,null,null,null)
B.OW=new A.a0("No prone pain",null,null,null,null,null,null,null)
B.OX=new A.a0("Screening your back pain",null,B.f1,null,null,null,null,null)
B.OY=new A.a0("To help give us an even better idea to the cause of your pain, we will now perform a few tests. Again the goal is to identify postures, motions and loads that trigger your pain and those that can be performed without. By pinpointing these problematic factors and making the invisible now visible, we can then work to decrease your symptoms and return to lifting pain free.",null,B.bk,null,null,null,null,null)
B.OZ=new A.a0("Back Pain : Load Testing Assessment",null,null,null,null,null,null,null)
B.P_=new A.a0('There is always a reason for back pain. It doesn\u2019t just appear out of thin air and it\u2019s not "all in your head." In order to fix and remove the pain, we need to find out why it started in the first place.',null,B.bk,null,null,null,null,null)
B.P0=new A.a0("Start by sitting on a stool with your arms by your side. Assume a good postured \u201ctall\u201d position with your spine in neutral (there will be a small arch in your low back).",null,null,null,null,null,null,null)
B.P2=new A.a0("Find a wall and kneel close to it with your shoes off. Use a tape measure and place your big toe 5 inches from the wall. From this position, push your knee forward attempting to touch the wall with your knee. Your heel must stay in contact with the ground.",null,null,null,null,null,null,null)
B.P3=new A.a0("The hips are an area of the body that show a tendency to benefit from increased mobility due to its inclination to become immobile and stiff. If the hips stiffen, they will affect the role of the joint complex directly above (the low back) and cause it to become unstable. For this reason, a thorough evaluation for a back injury must include an assessment of hip mobility!",null,null,null,null,null,null,null)
B.P4=new A.a0("Next, pick up an unloaded barbell and hold it at your waist in the hang position. Let the barbell drop down to the middle of your shins as if you are performing an RDL (Romanian Deadlift). If you don\u2019t have a barbell, just mimic the motion by having your hands by your side.",null,B.bk,null,null,null,null,null)
B.P6=new A.a0("Back Pain : Hip Rotation Assessment",null,null,null,null,null,null,null)
B.P5=new A.a0("Back Pain : Thoracic Spine Mobility Assessment",null,null,null,null,null,null,null)
B.P7=new A.a0("Back Pain: Deadlift Assessment",null,null,null,null,null,null,null)
B.Pa=new A.a0("When you raised your hip off the bed this time, did your symptoms change? If so this suggests extension intolerance with a rotational component, meaning your low back is sustaining uneven forces when one leg moves behind you. This can clue someone to why you may have pain when moving into a weightlifting split jerk position!",null,null,null,null,null,null,null)
B.Pb=new A.a0("A simple way to determine if the weight you are lifting (the load) is a trigger for your pain, is to perform a simple weighted front raise screen. Start by holding a light dumbbell or kettle bell by your stomach (anything between 5-15 lbs. works great). Keep your core relaxed and raise the weight out in front of you without your arms bending. What happened to your pain level? If extending the weight caused your back pain, try the same motion again but this time brace your core muscles and then move the weight. Did you notice any difference in your pain levels?",null,null,null,null,null,null,null)
B.wn=new A.a0("If this motion creates pain during the screening of the squat, you likely have a flexion intolerance problem. The presence of pain in this deep squat with a rounded back is clueing you that the position of your pelvis when lifting is a factor in creating your symptoms. Your first step is to be cognizant of how much butt wink your body has when squatting or dropping under a clean or snatch. This can also be a result of stiff ankels so the next step is to check out the mobility of your ankles.",null,null,null,null,null,null,null)
B.Pd=new A.a0("If pain was produced by extended your leg off the bed (the movement of hip extension) place a pillow under your stomach. Try the same test again, but this time brace your core muscles like you\u2019re about to get punched in the stomach and don\u2019t allow your opposite leg (the one that is remaining flat on the bed) to push into the bed (the movement of hip flexion).",null,null,null,null,null,null,null)
B.wo=new A.a0('Poor posture causes certain muscles of our body to remain \u201con\u201d and active during the day. Many people who develop back pain assume postures that don\u2019t allow their low back muscles to relax.If this is you, try to change your posture right now by using the cue to "stand tall" or "stand like a military officer" and see how that affects your low back stiffness. Brace your core slightly, squeeze your glutes and try to stand with "perfect posture." Did anything change? The goal is to teach your body a new way to stand that is pain-free and alleviates tension in your body. If changing the way you stand already modified your pain levels, you have found a way to modify and wind-down your symptoms!',null,B.bk,null,null,null,null,null)
B.Pe=new A.a0("One of the simplest screens to assess how your body responds to certain postures while lifting is to use a seated compressive test. This is a test I picked up from Dr. Stuart McGill, and have found it to be very helpful in the evaluation process with my patients.",null,null,null,null,null,null,null)
B.Pg=new A.a0("If you noticed your pain was eliminated (or significantly decreased) with the core braced before extending the weight, we can assume your body has an instability problem and the loads you are lifting are leading to your pain. Learning to stiffen your body with purposeful core stability exercises will be key for your recovery.",null,null,null,null,null,null,null)
B.Ph=new A.a0("Did you have a rotational imbalance?",null,null,null,null,null,null,null)
B.Pi=new A.a0("Next",null,null,null,null,null,null,null)
B.Pj=new A.a0("Did correcting your low back position by holding it in neutral, bracing your core, and hinging from the hips decrease your pain?",null,null,B.dI,null,null,null,null)
B.Pl=new A.a0("Flexion or Extension",null,null,null,null,null,null,null)
B.Pm=new A.a0("Compression",null,null,null,null,null,null,null)
B.Pn=new A.a0("As we sit all day and use poor posture, our mid back stiffens. If we don\u2019t have adequate mobility in this area, the joint below (the low back) will be forced to move as compensation. This problem is often seen with overhead barbell lifting (snatch, jerk, and the overhead squat).",null,null,null,null,null,null,null)
B.Po=new A.a0("Hold this for a few seconds and then return to the start position. What did you experience? If you had pain during the motion of bending forward, it means you have a flexion problem. If, however, you didn't have pain while bending over but had pain during the return movement, it's a sign of having an extension issue. Athletes who have pain upon returning from this forward position frequently move from their low back first and THEN the hips (lumbar extension followed by hip extension).",null,B.bk,null,null,null,null,null)
B.Pp=new A.a0("Back",null,null,null,null,null,null,null)
B.MK=new A.r(!0,B.k,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.Pq=new A.a0("Go to home page",null,B.MK,null,null,null,null,null)
B.Pr=new A.a0("Why does ankle mobility matter when it comes to low back pain? When the ankle becomes stiff and immobile (particularly in the movement of dorsiflexion) the knee will be unable to push forward over the toes during the deepest portion of the squat. This means if you continue to descend into a deep squat, another part of your body (the pelvis and low back) has to give way and move excessively. In order to see if you ankle is part of the problem, were are going to try the five inch wall test",null,null,null,null,null,null,null)
